import React, {Component} from 'react';
import '../assets/css/bootstrap.min.css';
import '../assets/css/main.css';
import Header from '../components/header';
// import ListArticleData from './list-article-data';
// import TopArticleData from './top-article-data';

class Login extends Component{
    render(){
        return (
            <div>
                <Header/>
                <div className="container">
                    <div className="margin-atas">
                        <div className="row">
                            <div className="col-md-4">

                            </div>
                            <div className="col-md-4">
                                <form className="login-form" action="">
                                    <h2 className="text-center">Log in</h2>
                                    <div className="form-group">
                                        <label for="uname"><b>Username</b></label>
                                            <input className="form-control" type="text" placeholder="Enter Username" name="uname" required/>
                                        <label for="psw"><b>Password</b></label>
                                            <input className="form-control" type="password" placeholder="Enter Password" name="psw" required/>
                                        <button className="btn btn-primary btn-block" type="submit">Login</button>  
                                    </div>
                                </form> 
                            </div>
                        </div>
                    </div>
                </div>
            </div>   
        );
    }
}
export default Login;
